import Link from 'next/link';
import Button from 'react-bootstrap/Button';
import Navbar from "react-bootstrap/Navbar";
import Container from 'react-bootstrap/Container';
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];

const linkStyle = {
  marginRight: 15,
}
const Header = () => {
  return (
    <Navbar sticky="top" expand="lg">
      <Container>
        <ul>
        <li>
          {services_array.map(service => (
            <div>
                <Button variant="light" style={linkStyle}>
                <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
                  <span>{service}</span>
                </Link>
                </Button>
                </div>
          ))}
          </li>
        </ul>
    </Container>
  </Navbar>
);
}

export default Header



